  checkLoggedIn(){
    var user = localStorage.getItem("oc_loggedIn");
    if(user){
        console.log(user);
        //redir to home.

    }else{
        console.log(document.referrer);
    }
}

componentDidMount(){
  this.checkLoggedIn();
}


